import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <center>
        <h1>Rhenz Ganotice</h1>
        <h3>BS Computer Science</h3>
        <a href="https://www.umak.edu.ph" target="_blank" rel="noopener noreferrer">
  <h5>BSCS - University of Makati</h5>
</a>
        </center>

      </header>
    </div>
  );
}

export default App;
